import React, { useEffect } from "react";
import { ThemeProvider, createTheme, styled } from "@mui/material/styles";
import { CssBaseline, Box, Paper } from "@mui/material";
import Header from "./components/Header/Header";
import Grid from "@mui/material/Unstable_Grid2";

const theme = createTheme({
  palette: {
    primary: {
      main: "#007bff",
    },
    secondary: {
      main: "#28a745",
    },
  },
});

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function App() {
  useEffect(() => {
    const fetchData = async () => {
      const BASE_URL = "https://maps.googleapis.com/maps/api/place";
      const GOOGLE_API_KEY = "YOUR_API_KEY_HERE"; // Replace with your API key
      const category = "restaurant";
      const radius = "50000";
      const lat = "-26.1507068";
      const lng = "28.367639";

      const apiUrl = `${BASE_URL}/textsearch/json?query=${category}&location=${lat},${lng}&radius=${radius}&key=${GOOGLE_API_KEY}`;

      try {
        const response = await fetch(apiUrl, {
          headers: {
            "Content-Type": "application/json",
          },
        });

        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const data = await response.json();
        console.log("API response received", data);
        // Process data as needed
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Header />
      <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={2}>
          <Grid xs={12} sm={12} md={4}>
            <Item>{/**  <List places={places} />**/}</Item>
          </Grid>
          <Grid xs={12} sm={12} md={8}>
            <Item>{/* Display error or other content */}</Item>
          </Grid>
        </Grid>
      </Box>
    </ThemeProvider>
  );
}

export default App;
